import React from 'react';

function Food(name) {
  return <h3>i love {name}</h3>
}

const favroiteFood = [
  {
    name: "kimchi",
    price: "high"
  },
  {
    name: "gimbap",
    price: "chip"
  },
  {
    name: "짜장면",
    price: "middium"
  }
];

function App() {
  return (<div >
    {favroiteFood.map(dish =>
      <Food name={dish.name} />
    )}
  </div>
  );
}

export default App;
